/**
 * @module data
 * @file 获取添加的 feed 城市列表
 * @author wangyongqing <wangyongqing01@baidu.com>
 */

import register from '../register';
import {get} from './index';
import {getParams} from '../utils';
register('feed/getAddedCity', {
    v: 19,
    versionRange: ['10.3'],
    androidliteVersionRange: ['3.6'],
    iosinfoVersionRange: ['3.6'],
    iosmissionVersionRange: ['1.0'],
    androidmissionVersionRange: ['1.0'],
    filter: () => {
        return {
            module: 'feed/tabopt',
            action: 'getAddedCity'
        };
    }
});
/**
 * feed setAddCity
 * @function setAddCity
 */
export default () => get(getParams('feed-addedCity'));
